import Logo from "../../assets/images/rae-chastain-logo.png";
import NavLinks from "../atoms/NavLinks";

const NavBar = () => {
    const navItems = [
        {
            label: "Books",
            link: "/home"
        },
        {
            label: "Illustrations",
            link: "/illustrations"
        },
        {
            label: "Blog",
            link: "/blog"
        },
        {
            label: "About",
            link: "about"
        },
        {
            label: "Contact",
            link: "contact"
        }
    ];

    return (
        <nav>
            <img src={Logo} alt="rae chastain's logo" />
            <NavLinks navItems={navItems} />
        </nav>
    );
};

export default NavBar;
